import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import withLayout from 'nextra-theme-docs'
import { withSSG } from 'nextra/ssg'
import layoutConfig from 'C:/Users/paul/Documents/Projects/eezyquote/react-google-places-autocomplete/docs/theme.config.js'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const MDXLayout = function NextraPage (props) {
    return withSSG(withLayout({
      filename: "C:/Users/paul/Documents/Projects/eezyquote/react-google-places-autocomplete/docs/pages/utility-functions/geocode-by-address.md",
      route: "/utility-functions/geocode-by-address",
      meta: {},
      pageMap: [{"name":"examples","route":"\\examples"},{"name":"index","route":"\\"},{"name":"meta.json","meta":{"index":"Getting Started","props":"Props","examples":"Examples","utility-functions":"Utility functions"}},{"name":"props","route":"\\props"},{"name":"utility-functions","children":[{"name":"geocode-by-address","route":"\\utility-functions\\geocode-by-address"},{"name":"geocode-by-place-id","route":"\\utility-functions\\geocode-by-place-id"},{"name":"get-latitude-and-longitude","route":"\\utility-functions\\get-latitude-and-longitude"},{"name":"meta.json","meta":{"geocode-by-address":"Geocode by Address","geocode-by-place-id":"Geocode by Place ID","get-latitude-and-longitude":"Get Latitude and Longitude"}}],"route":"\\utility-functions"}]
    }, layoutConfig))(props)
}
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...props} components={components} mdxType="MDXLayout">
    <p>{`This functions allows to get results by an address using `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/geocoding",
        "parentName": "p"
      }}>{`Google Maps Geocoder`}</a>
      {`.`}</p>
    <h2>{`Firm`}</h2>
    <pre><code {...{
        "className": "language-tsx",
        "parentName": "pre"
      }}>{`const geocodeByAddress = (address: string): Promise<google.maps.GeocoderResult[]>;
`}</code></pre>
    <h2>{`Usage`}</h2>
    <pre><code {...{
        "className": "language-js",
        "parentName": "pre"
      }}>{`import { geocodeByAddress } from '@eezyquote/react-google-places';

geocodeByAddress('La penne-sur-huveaune, France')
  .then(results => console.log(results))
  .catch(error => console.error(error));
`}</code></pre>

  </MDXLayout>;
}

;
